import React, { Component } from 'react'
import '../styles/App.css';

class NotFound extends Component {
  render(){
    return(
      <div className='content text-center'>
        <h1 className='mx-auto'> 404 PAGE NOT FOUND </h1>
      </div>
    )
  }
}

export default NotFound;
